import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminDashboard = () => {
  const [complaints, setComplaints] = useState([]);

  // Fetch complaints from backend
  const fetchComplaints = async () => {
    try {
      const res = await axios.get("/api/admin/complaints");
      if (res.data.success) {
        setComplaints(res.data.complaints);
      } else {
        console.error(res.data.message);
      }
    } catch (err) {
      console.error("Error fetching complaints:", err);
    }
  };

  useEffect(() => {
    fetchComplaints();
  }, []);

  // Handle status change
  const handleStatusChange = async (id, newStatus) => {
    try {
      const res = await axios.post("/api/admin/update_status", {
        id,
        status: newStatus,
      });
      if (res.data.success) {
        // Update the complaint status locally
        setComplaints(prev =>
          prev.map(c =>
            c.id === id ? { ...c, status: newStatus } : c
          )
        );
      } else {
        alert(res.data.message);
      }
    } catch (err) {
      console.error("Error updating status:", err);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold mb-6 text-center text-blue-700">Admin Complaint Dashboard</h1>

      <div className="overflow-x-auto">
        <table className="w-full table-auto bg-white rounded-lg shadow">
          <thead className="bg-blue-600 text-white">
            <tr>
              <th className="px-4 py-2">ID</th>
              <th className="px-4 py-2">Name</th>
              <th className="px-4 py-2">Location</th>
              <th className="px-4 py-2">Department</th>
              <th className="px-4 py-2">Status</th>
              <th className="px-4 py-2">Token</th>
              <th className="px-4 py-2">Timestamp</th>
            </tr>
          </thead>
          <tbody>
            {complaints.length === 0 ? (
              <tr>
                <td colSpan="7" className="text-center py-6 text-gray-500">
                  No complaints found.
                </td>
              </tr>
            ) : (
              complaints.map(c => (
                <tr key={c.id} className="text-center hover:bg-gray-50 transition duration-150">
                  <td className="border py-2 px-4">{c.id}</td>
                  <td className="border py-2 px-4">{c.name}</td>
                  <td className="border py-2 px-4">{c.location}</td>
                  <td className="border py-2 px-4">{c.department || "Unknown"}</td>
                  <td className="border py-2 px-4">
                    <select
                      value={c.status}
                      onChange={e => handleStatusChange(c.id, e.target.value)}
                      className={`border px-2 py-1 rounded-md text-sm ${
                        c.status === "Resolved"
                          ? "text-green-600"
                          : c.status === "Pending"
                          ? "text-yellow-600"
                          : "text-gray-600"
                      }`}
                    >
                      <option value="Pending">Pending</option>
                      <option value="Processing">Processing</option>
                      <option value="Resolved">Resolved</option>
                    </select>
                  </td>
                  <td className="border py-2 px-4 text-xs">{c.token}</td>
                  <td className="border py-2 px-4">{new Date(c.timestamp).toLocaleString()}</td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminDashboard;
